script: |
  super -f text -I q3585.spq | sort > q3585.out

inputs:
  - name: q3585.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - 60 NOT BETWEEN ( col1 ) * col1 + + 92 * - col1 * - 68 AND 77;
  - name: tab1

outputs:
  - name: q3585.out
    data: |
      51	14	96
      85	5	59
      91	47	68
